INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 302, 1, 119901, 119901, "2024/12/31 11:59:59", 0, 0, 14, "2024/12/22 12:00:00", 0, 3, "みやこ", 1, 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 450, 119901, 0, 2.17, 0, 0, 1, "ミヤコ（クリスマス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 190, 1, 120001, 120001, "2025/03/15 14:59:59", 0, 0, 6, "2025/03/10 12:00:00", 0, 3, "しずる", 5, 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 450, 120001, 0, 2.375, 0, 0, 5, "シズル（ノワール）", 1);
