INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 283, 1, 120701, 120701, "2025/01/20 11:59:59", 0, 0, 1, "2025/01/15 15:00:00", 0, 3, "しぇふぃ", 22, 120701, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 450, 120701, 0, 1.84, 0, 0, 4, "シェフィ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 193, 1, 120801, 120801, "2030/12/31 15:00:00", 0, 0, 2, "2023/10/16 15:00:00", 0, 1, "るか", 22, 120801, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 450, 120801, 0, 1.3, 0, 0, 4, "ルカ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 424, 2, 120901, 120901, "2025/01/20 11:59:59", 0, 0, 12, "2025/01/15 15:00:00", 0, 3, "いりや", 38, 120901, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 450, 120901, 0, 1.425, 0, 0, 3, "イリヤ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 164, 1, 121001, 121001, "2025/02/24 11:59:59", 0, 0, 1, "2025/02/20 12:00:00", 0, 3, "ぺこりーぬ", 41, 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 450, 121001, 0, 2.25, 0, 0, 5, "ペコリーヌ（オーバーロード）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 588, 2, 121101, 121101, "2025/02/24 11:59:59", 0, 0, 1, "2025/02/20 12:00:00", 0, 3, "きゃる", 42, 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 450, 121101, 0, 2.07, 0, 0, 7, "キャル（オーバーロード）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 260, 1, 121201, 121201, "2030/12/31 15:00:00", 0, 0, 6, "2023/11/16 15:00:00", 0, 1, "らびりすた", 40, 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 450, 121201, 0, 1.55, 0, 0, 4, "ラビリスタ（オーバーロード）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 731, 1, 121301, 121301, "2030/12/31 15:00:00", 0, 0, 3, "2022/03/03 19:00:00", 0, 3, "くるみ", 3, 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 450, 121301, 0, 1.9, 0, 0, 3, "クルミ（ステージ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 742, 2, 121401, 121401, "2030/12/31 15:00:00", 0, 0, 15, "2022/03/15 15:00:00", 0, 3, "みさき", 7, 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 450, 121401, 0, 2.27, 0, 0, 7, "ミサキ（ステージ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 590, 1, 121501, 121501, "2025/04/30 11:59:59", 0, 0, 12, "2025/04/26 12:00:00", 0, 3, "あゆみ", 6, 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 450, 121501, 0, 2.0, 0, 0, 6, "アユミ（怪盗）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 292, 1, 121601, 121601, "2030/12/31 15:00:00", 0, 0, 17, "2022/04/15 15:00:00", 0, 3, "いのり", 3, 121601, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 450, 121601, 0, 1.425, 0, 0, 3, "イノリ（怪盗）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 421, 0, 0, 121701, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 180901, 3, "あきの", 0, 121701, "", 0, 0, 0, 0.0, 0, 0, 0, "アキノ（アキノ＆サレン）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 421, 0, 0, 121801, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 180901, 3, "されん", 0, 121801, "", 0, 0, 0, 0.0, 0, 0, 0, "サレン（アキノ＆サレン）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 293, 2, 121901, 121901, "2030/12/31 15:00:00", 0, 0, 12, "2022/05/15 15:00:00", 0, 3, "あんな", 5, 121901, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 450, 121901, 0, 2.125, 0, 0, 5, "アンナ（パイレーツ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 380, 1, 122001, 122001, "2030/12/31 15:00:00", 0, 0, 14, "2022/05/03 19:00:00", 0, 3, "しのぶ", 3, 122001, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 450, 122001, 0, 1.425, 0, 0, 3, "シノブ（パイレーツ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 731, 1, 122101, 122101, "2030/12/31 15:00:00", 0, 0, 9, "2024/04/18 15:00:00", 0, 1, "あおい", 35, 122101, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 450, 122101, 0, 1.97, 0, 0, 35, "アオイ（キャンプ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 419, 1, 122201, 122201, "2030/12/31 15:00:00", 0, 0, 8, "2022/05/31 12:00:00", 0, 3, "ゆかり", 4, 122201, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 450, 122201, 0, 1.84, 0, 0, 4, "ユカリ（キャンプ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 564, 2, 122301, 122301, "2030/12/31 15:00:00", 0, 0, 0, "2022/06/15 15:00:00", 0, 3, "うぁんぴぃ", 43, 122301, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 450, 122301, 0, 1.425, 0, 0, 43, "ヴァンピィ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 264, 1, 122401, 122401, "2030/12/31 15:00:00", 0, 0, 8, "2024/06/17 15:00:00", 0, 1, "ひより", 1, 122401, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 450, 122401, 0, 2.42, 0, 0, 1, "ヒヨリ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 250, 1, 122501, 122501, "2025/08/31 11:59:59", 0, 0, 0, "2025/08/22 12:00:00", 0, 3, "れい", 4, 122501, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 450, 122501, 0, 1.965, 0, 0, 4, "レイ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 554, 2, 122601, 122601, "2030/12/31 15:00:00", 0, 0, 0, "2022/07/15 15:00:00", 0, 3, "ゆい", 7, 122601, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 450, 122601, 0, 2.27, 0, 0, 7, "ユイ（サマー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 812, 2, 122701, 122701, "2030/12/31 15:00:00", 0, 0, 0, "2022/08/15 15:00:00", 0, 3, "きょうか", 7, 122701, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 450, 122701, 0, 1.92, 0, 0, 7, "キョウカ（サマー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 237, 1, 122801, 122801, "2030/12/31 15:00:00", 0, 0, 0, "2024/07/16 15:00:00", 0, 1, "みそぎ", 1, 122801, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 450, 122801, 0, 2.295, 0, 0, 1, "ミソギ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 361, 1, 122901, 122901, "2025/08/31 11:59:59", 0, 0, 0, "2025/08/22 12:00:00", 0, 3, "みみ", 5, 122901, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 450, 122901, 0, 2.25, 0, 0, 5, "ミミ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 746, 2, 123001, 123001, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "あめす", 44, 123001, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 450, 123001, 0, 2.27, 0, 0, 44, "アメス", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 793, 2, 123101, 123101, "2030/12/31 15:00:00", 0, 0, 0, "2022/09/03 19:00:00", 0, 3, "まほ", 7, 123101, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 450, 123101, 0, 1.795, 0, 0, 7, "マホ（エクスプローラー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 256, 1, 123201, 123201, "2030/12/31 15:00:00", 0, 0, 0, "2022/09/15 15:00:00", 0, 3, "あやね", 3, 123201, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 450, 123201, 0, 1.425, 0, 0, 3, "アヤネ（エクスプローラー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 350, 1, 123301, 123301, "2025/09/30 11:59:59", 0, 0, 0, "2025/09/16 15:00:00", 0, 3, "ねあ", 0, 123301, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 450, 123301, 0, 1.62, 0, 0, 1, "ネア", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 123401, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "じゅん", 5, 123401, "", 0, 0, 0, 0.0, 0, 0, 5, "ジュン（キャンプ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 583, 1, 123501, 123501, "2030/12/31 15:00:00", 0, 0, 0, "2024/09/17 15:00:00", 0, 1, "りん", 6, 123501, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 450, 123501, 0, 2.34, 0, 0, 6, "リン（ハロウィン）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 262, 1, 123601, 123601, "2025/11/30 11:59:59", 0, 0, 0, "2025/11/14 15:00:00", 0, 3, "とも", 4, 123601, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 450, 123601, 0, 1.965, 0, 0, 4, "トモ（ハロウィン）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 741, 2, 123701, 123701, "2030/12/31 15:00:00", 0, 0, 0, "2022/10/15 15:00:00", 0, 3, "ななか", 21, 123701, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 450, 123701, 0, 2.07, 0, 0, 7, "ナナカ（ハロウィン）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 238, 1, 123801, 123801, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "くりすてぃーな", 1, 123801, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 450, 123801, 0, 2.295, 0, 0, 1, "クリスティーナ（ワイルド）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 183, 1, 123901, 123901, "2030/12/31 15:00:00", 0, 0, 0, "2022/11/15 15:00:00", 0, 3, "まつり", 2, 123901, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 450, 123901, 0, 2.125, 0, 0, 2, "マツリ（ワイルド）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 438, 2, 124001, 124001, "2024/12/31 11:59:59", 0, 0, 0, "2024/12/22 12:00:00", 0, 3, "あかり", 7, 124001, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 450, 124001, 0, 2.07, 0, 0, 7, "アカリ（クリスマス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 433, 2, 124101, 124101, "2030/12/31 15:00:00", 0, 0, 0, "2024/11/16 15:00:00", 0, 1, "より", 6, 124101, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 450, 124101, 0, 1.965, 0, 0, 6, "ヨリ（クリスマス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 144, 1, 124201, 124201, "2030/12/31 15:00:00", 0, 0, 0, "2022/12/23 12:00:00", 0, 3, "じゅん", 5, 124201, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 450, 124201, 0, 2.07, 0, 0, 5, "ジュン（クリスマス）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 577, 0, 0, 124301, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 181001, 3, "あん", 0, 124301, "", 0, 0, 0, 0.0, 0, 0, 0, "アン（アン＆グレア）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 577, 0, 0, 124401, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 181001, 3, "ぐれあ", 0, 124401, "", 0, 0, 0, 0.0, 0, 0, 0, "グレア（アン＆グレア）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 707, 2, 124501, 124501, "2025/01/20 11:59:59", 0, 0, 0, "2025/01/15 15:00:00", 0, 3, "ほまれ", 21, 124501, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 450, 124501, 0, 2.07, 0, 0, 7, "ホマレ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 698, 2, 124601, 124601, "2025/01/20 11:59:59", 0, 0, 0, "2025/01/15 15:00:00", 0, 3, "みさと", 21, 124601, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 450, 124601, 0, 2.44, 0, 0, 7, "ミサト（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 590, 1, 124701, 124701, "2030/12/31 15:00:00", 0, 0, 0, "2024/12/16 15:00:00", 0, 1, "みつき", 46, 124701, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 450, 124701, 0, 2.24, 0, 0, 7, "ミツキ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 423, 1, 124801, 124801, "2025/02/24 11:59:59", 0, 0, 0, "2025/02/20 12:00:00", 0, 3, "のぞみ", 0, 124801, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 450, 124801, 0, 2.14, 0, 0, 4, "ノゾミ（リベレイター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 170, 1, 124901, 124901, "2030/12/31 15:00:00", 0, 0, 0, "2025/01/16 15:00:00", 0, 1, "かや", 0, 124901, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 450, 124901, 0, 1.965, 0, 0, 1, "カヤ（リベレイター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 221, 1, 125001, 125001, "2025/02/24 11:59:59", 0, 0, 0, "2025/02/20 12:00:00", 0, 3, "むいみ", 0, 125001, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 450, 125001, 0, 1.965, 0, 0, 5, "ムイミ（リベレイター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 825, 1, 125101, 125101, "2030/12/31 15:00:00", 0, 0, 0, "2023/03/03 19:00:00", 0, 3, "たまき", 47, 125101, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 450, 125101, 0, 2.24, 0, 0, 8, "タマキ（カフェ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 463, 1, 125201, 125201, "2030/12/31 15:00:00", 0, 0, 0, "2023/03/10 12:00:00", 0, 3, "もにか", 4, 125201, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 450, 125201, 0, 1.965, 0, 0, 4, "モニカ（カフェ）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 752, 1, 125301, 125301, "2025/04/30 11:59:59", 0, 0, 0, "2025/04/26 12:00:00", 0, 3, "こっころ", 6, 125301, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 450, 125301, 0, 2.07, 0, 0, 6, "コッコロ（レンジャー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 710, 1, 125401, 125401, "2030/12/31 15:00:00", 0, 0, 0, "2023/04/10 12:00:00", 0, 3, "しおり", 8, 125401, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 450, 125401, 0, 2.09, 0, 0, 8, "シオリ（レンジャー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 443, 2, 125501, 125501, "2025/05/31 11:59:59", 0, 0, 0, "2025/05/15 15:00:00", 0, 3, "じーた", 50, 125501, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 450, 125501, 0, 1.92, 0, 0, 7, "ジータ（ウォーロック）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 267, 1, 125601, 125601, "2025/05/31 11:59:59", 0, 0, 0, "2025/05/15 15:00:00", 0, 3, "びから", 0, 125601, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 450, 125601, 0, 2.09, 0, 0, 51, "ビカラ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 579, 2, 125701, 125701, "2030/12/31 15:00:00", 0, 0, 0, "2025/04/16 15:00:00", 0, 1, "かりん", 9, 125701, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 450, 125701, 0, 2.24, 0, 0, 7, "カリン（アルケミスト）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 464, 1, 125801, 125801, "2030/12/31 15:00:00", 0, 0, 0, "2023/04/17 12:00:00", 0, 3, "りり", 0, 125801, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 450, 125801, 0, 2.09, 0, 0, 3, "リリ（フォールン）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 125901, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "かや", 1, 125901, "", 0, 0, 0, 0.0, 0, 0, 1, "カヤ（リベレイター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 406, 1, 126001, 126001, "2030/12/31 15:00:00", 0, 0, 0, "2023/10/31 12:00:00", 0, 3, "くりあ", 0, 126001, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 450, 126001, 0, 2.09, 0, 0, 0, "クリア（フォールン）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 480, 2, 126101, 126101, "2030/12/31 15:00:00", 0, 0, 0, "2023/11/15 15:00:00", 0, 3, "ぷれしあ", 53, 126101, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 450, 126101, 0, 2.09, 0, 0, 44, "プレシア（フォールン）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 568, 2, 126201, 126201, "2025/06/20 11:59:59", 0, 0, 0, "2025/06/10 12:00:00", 0, 3, "いりや", 3, 126201, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 450, 126201, 0, 2.09, 0, 0, 3, "イリヤ（儀装束）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 456, 2, 126301, 126301, "2030/12/31 15:00:00", 0, 0, 0, "2023/06/15 15:00:00", 0, 3, "ゆき", 9, 126301, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 450, 126301, 0, 2.07, 0, 0, 7, "ユキ（儀装束）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 373, 1, 126401, 126401, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "くろーちぇ", 1, 126401, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 450, 126401, 0, 2.09, 0, 0, 1, "クローチェ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 740, 2, 126501, 126501, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "らいらえる", 0, 126501, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 450, 126501, 0, 1.965, 0, 0, 7, "ライラエル", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 650, 2, 126601, 126601, "2025/08/15 14:59:59", 0, 0, 0, "2025/08/10 12:00:00", 0, 3, "ねねか", 7, 126601, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 450, 126601, 0, 2.04, 0, 0, 7, "ネネカ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 224, 1, 126701, 126701, "2030/12/31 15:00:00", 0, 0, 0, "2025/06/17 15:00:00", 0, 1, "あきの", 5, 126701, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 450, 126701, 0, 1.965, 0, 0, 5, "アキノ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 159, 1, 126801, 126801, "2030/12/31 15:00:00", 0, 0, 0, "2023/07/15 15:00:00", 0, 3, "ゆかり", 5, 126801, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 450, 126801, 0, 1.97, 0, 0, 5, "ユカリ（サマー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 682, 2, 126901, 126901, "2025/08/31 11:59:59", 0, 0, 0, "2025/08/22 12:00:00", 0, 3, "らんふぁ", 21, 126901, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 450, 126901, 0, 1.965, 0, 0, 7, "ランファ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 133, 1, 127001, 127001, "2030/12/31 15:00:00", 0, 0, 0, "2025/07/16 15:00:00", 0, 1, "くうか", 52, 127001, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 450, 127001, 0, 1.97, 0, 0, 2, "クウカ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 255, 1, 127101, 127101, "2025/08/31 11:59:59", 0, 0, 0, "2025/08/22 12:00:00", 0, 3, "しのぶ", 46, 127101, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 450, 127101, 0, 2.09, 0, 0, 5, "シノブ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 804, 2, 127201, 127201, "2025/09/30 11:59:59", 0, 0, 0, "2025/09/16 15:00:00", 0, 3, "きゃる", 7, 127201, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 450, 127201, 0, 2.09, 0, 0, 7, "キャル（編入生）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 750, 1, 127301, 127301, "2030/12/31 15:00:00", 0, 0, 0, "2023/09/15 15:00:00", 0, 3, "すずな", 8, 127301, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 450, 127301, 0, 2.09, 0, 0, 8, "スズナ（編入生）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 127401, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "びから", 1, 127401, "", 0, 0, 0, 0.0, 0, 0, 1, "ビカラ（コラボ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 304, 1, 127501, 127501, "2024/11/18 11:59:59", 0, 0, 0, "2024/11/11 12:00:00", 0, 3, "されん", 4, 127501, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 450, 127501, 0, 2.09, 0, 0, 4, "サレン（サラサリア）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 157, 1, 127601, 127601, "2030/12/31 15:00:00", 0, 0, 0, "2023/10/15 15:00:00", 0, 3, "るか", 4, 127601, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 450, 127601, 0, 1.965, 0, 0, 4, "ルカ（サラサリア）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 693, 2, 127701, 127701, "2030/12/31 15:00:00", 0, 0, 0, "2024/10/10 12:00:00", 0, 3, "りんど", 48, 127701, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 450, 127701, 0, 1.965, 0, 0, 6, "リンド", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 706, 2, 127801, 127801, "2030/12/31 15:00:00", 0, 0, 0, "2024/10/18 12:00:00", 0, 3, "うるむ", 47, 127801, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 450, 127801, 0, 1.965, 0, 0, 7, "ヴルム", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 372, 2, 127901, 127901, "2024/12/15 14:59:59", 0, 0, 0, "2024/12/09 12:00:00", 0, 3, "ぺこりーぬ", 5, 127901, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 450, 127901, 0, 1.965, 0, 0, 5, "ペコリーヌ（クリスマス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 723, 1, 128001, 128001, "2030/12/31 15:00:00", 0, 0, 0, "2023/12/15 15:00:00", 0, 3, "くれじった", 35, 128001, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 450, 128001, 0, 2.09, 0, 0, 35, "クレジッタ（クリスマス）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 580, 0, 0, 128101, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 181101, 3, "しずる", 0, 128101, "", 0, 0, 0, 0.0, 0, 0, 0, "シズル（シズル&リノ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 580, 0, 0, 128201, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 181101, 3, "りの", 0, 128201, "", 0, 0, 0, 0.0, 0, 0, 0, "リノ（シズル&リノ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 191, 1, 128301, 128301, "2030/12/31 15:00:00", 0, 1, 0, "2023/12/31 12:00:00", 0, 1, "いのり", 38, 128301, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 450, 128301, 0, 2.09, 0, 0, 3, "イノリ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 801, 2, 128401, 128401, "2025/01/15 14:59:59", 0, 0, 0, "2025/01/09 12:00:00", 0, 3, "はつね", 21, 128401, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 450, 128401, 0, 2.09, 0, 0, 7, "ハツネ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 739, 2, 128501, 128501, "2025/01/15 14:59:59", 0, 0, 0, "2025/01/09 12:00:00", 0, 3, "かすみ", 21, 128501, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 450, 128501, 0, 2.09, 0, 0, 7, "カスミ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 128601, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "りり", 1, 128601, "", 0, 0, 0, 0.0, 0, 0, 1, "リリ（フォールン）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 226, 1, 128701, 128701, "2025/02/15 14:59:59", 0, 0, 0, "2025/02/10 12:00:00", 0, 3, "ひより", 0, 128701, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 450, 128701, 0, 2.09, 0, 0, 1, "ヒヨリ（アストラル）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 194, 1, 128801, 128801, "2030/12/31 15:00:00", 0, 0, 0, "2025/08/16 15:00:00", 0, 1, "れい", 0, 128801, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 450, 128801, 0, 1.965, 0, 0, 4, "レイ（アストラル）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 772, 2, 128901, 128901, "2025/02/15 14:59:59", 0, 0, 0, "2025/02/10 12:00:00", 0, 3, "ゆい", 0, 128901, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 450, 128901, 0, 2.09, 0, 0, 7, "ユイ（アストラル）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 800, 2, 129001, 129001, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "えりす", 0, 129001, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 450, 129001, 0, 2.09, 0, 0, 7, "エリス", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 708, 1, 129301, 129301, "2025/03/15 14:59:59", 0, 0, 0, "2025/03/10 12:00:00", 0, 3, "ゆに", 7, 129301, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 450, 129301, 0, 2.09, 0, 0, 7, "ユニ（ウィンター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 188, 1, 129401, 129401, "2030/12/31 15:00:00", 0, 0, 0, "2024/03/18 12:00:00", 0, 3, "くろえ", 2, 129401, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 450, 129401, 0, 2.09, 0, 0, 2, "クロエ（ウィンター）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 247, 1, 129501, 129501, "2025/06/27 11:59:59", 0, 0, 0, "2025/06/20 12:00:00", 0, 3, "ちえる", 1, 129501, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 450, 129501, 0, 2.09, 0, 0, 1, "チエル（ウィンター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 550, 1, 129601, 129601, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "あねもね", 0, 129601, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 450, 129601, 0, 2.09, 0, 0, 0, "アネモネ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 540, 1, 129701, 129701, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "ねふぃーねら", 0, 129701, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 450, 129701, 0, 2.09, 0, 0, 0, "ネフィ＝ネラ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 269, 1, 129801, 129801, "2025/04/30 11:59:59", 0, 0, 0, "2025/04/26 12:00:00", 0, 3, "まこと", 5, 129801, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 450, 129801, 0, 2.09, 0, 0, 5, "マコト（コマンダー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 294, 1, 129901, 129901, "2030/12/31 15:00:00", 0, 0, 0, "2024/04/15 15:00:00", 0, 3, "えりこ", 48, 129901, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 450, 129901, 0, 1.84, 0, 0, 6, "エリコ（コマンダー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 150, 1, 130001, 130001, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "やまと", 0, 130001, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 450, 130001, 0, 2.09, 0, 0, 4, "ヤマト", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 535, 1, 130101, 130101, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "わかな", 9, 130101, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 450, 130101, 0, 2.09, 0, 0, 7, "ワカナ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 371, 1, 130201, 130201, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "ふぶき", 0, 130201, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 450, 130201, 0, 1.84, 0, 0, 5, "フブキ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 130601, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "れい", 1, 130601, "", 0, 0, 0, 0.0, 0, 0, 4, "レイ（アストラル）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 563, 2, 130701, 130701, "2025/05/15 14:59:59", 0, 0, 0, "2025/05/03 19:00:00", 0, 3, "きょうか", 7, 130701, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 450, 130701, 0, 1.92, 0, 0, 7, "キョウカ（スプリング）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 558, 2, 130801, 130801, "2030/12/31 15:00:00", 0, 0, 0, "2024/05/15 15:00:00", 0, 3, "すずめ", 7, 130801, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 450, 130801, 0, 1.84, 0, 0, 7, "スズメ（スプリング）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 440, 2, 130901, 130901, "2030/12/31 15:00:00", 0, 0, 0, "2024/06/15 15:00:00", 0, 3, "くるる", 7, 130901, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 450, 130901, 0, 2.09, 0, 0, 7, "クルル", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 702, 2, 131001, 131001, "2025/06/20 11:59:59", 0, 0, 0, "2025/06/10 12:00:00", 0, 3, "まほ", 7, 131001, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 450, 131001, 0, 1.84, 0, 0, 7, "マホ（ドリームパーク）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 165, 1, 131101, 131101, "2030/12/31 15:00:00", 0, 0, 0, "2024/06/30 12:00:00", 0, 3, "ねあ", 52, 131101, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 450, 131101, 0, 2.09, 0, 0, 2, "ネア（サマー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 753, 2, 131201, 131201, "2025/07/23 11:59:59", 0, 0, 0, "2025/07/10 12:00:00", 0, 3, "みそら", 54, 131201, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 450, 131201, 0, 2.09, 0, 0, 54, "ミソラ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 131301, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 0, 3, "りり", 1, 131301, "", 0, 0, 0, 0.0, 0, 0, 1, "リリ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 131401, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 0, 3, "くりあ", 1, 131401, "", 0, 0, 0, 0.0, 0, 0, 1, "クリア", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 131501, "2030/12/31 15:00:00", 0, 1, 0, "2015/04/01 15:00:00", 0, 3, "ぷれしあ", 1, 131501, "", 0, 0, 0, 0.0, 0, 0, 1, "プレシア", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 399, 1, 131601, 131601, "2025/07/23 11:59:59", 0, 0, 0, "2025/07/10 12:00:00", 0, 3, "りり", 4, 131601, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 450, 131601, 0, 1.92, 0, 0, 4, "リリ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 743, 2, 131701, 131701, "2025/08/15 14:59:59", 0, 0, 0, "2025/08/10 12:00:00", 0, 3, "あめす", 53, 131701, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 450, 131701, 0, 1.92, 0, 0, 44, "アメス（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 709, 2, 131801, 131801, "2030/12/31 15:00:00", 0, 0, 0, "2024/08/15 15:00:00", 0, 3, "ほまれ", 21, 131801, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 450, 131801, 0, 2.09, 0, 0, 7, "ホマレ（サマー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 725, 2, 131901, 131901, "2030/12/31 15:00:00", 0, 1, 0, "2024/08/31 12:00:00", 0, 1, "えみりあ", 23, 131901, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 450, 131901, 0, 2.09, 0, 0, 7, "エミリア（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 775, 2, 132001, 132001, "2025/10/24 11:59:59", 0, 0, 0, "2025/10/10 12:00:00", 0, 3, "えきどな", 21, 132001, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 450, 132001, 0, 2.09, 0, 0, 7, "エキドナ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 146, 1, 132101, 132101, "2025/10/24 11:59:59", 0, 0, 0, "2025/10/10 12:00:00", 0, 3, "れむ", 24, 132101, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 450, 132101, 0, 2.09, 0, 0, 13, "レム（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 721, 2, 132201, 132201, "2025/10/31 11:59:59", 0, 0, 0, "2025/10/24 12:00:00", 0, 3, "のぞみ", 7, 132201, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 450, 132201, 0, 1.84, 0, 0, 7, "ノゾミ（アルケミスト）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 754, 2, 132301, 132301, "2025/05/15 14:59:59", 0, 0, 0, "2025/05/03 19:00:00", 0, 3, "るいずまりー", 7, 132301, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 450, 132301, 0, 2.09, 0, 0, 7, "ルイズマリー", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 501, 1, 132401, 132401, "2030/12/31 15:00:00", 0, 0, 0, "2025/06/20 12:00:00", 0, 3, "いろは", 0, 132401, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 450, 132401, 0, 2.09, 0, 0, 5, "イロハ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 636, 2, 132501, 132501, "2030/12/31 15:00:00", 0, 0, 0, "2025/05/15 15:00:00", 0, 3, "その", 23, 132501, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 450, 132501, 0, 2.09, 0, 0, 7, "ソノ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 750, 2, 132801, 132801, "2025/06/20 11:59:59", 0, 0, 0, "2025/06/10 12:00:00", 0, 3, "らいらえる", 0, 132801, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 450, 132801, 0, 2.09, 0, 0, 7, "ライラエル（クリスマス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 748, 2, 132901, 132901, "2030/12/31 15:00:00", 0, 0, 0, "2024/12/09 12:00:00", 0, 3, "いお", 46, 132901, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 450, 132901, 0, 2.09, 0, 0, 5, "イオ（クリスマス）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 234, 1, 133001, 133001, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "ぐれいす", 0, 133001, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 450, 133001, 0, 2.09, 0, 0, 0, "グレイス", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 154, 1, 133101, 133101, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "うぁいおれっと", 0, 133101, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 450, 133101, 0, 1.75, 0, 0, 0, "ヴァイオレット", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 296, 1, 133201, 133201, "2030/12/31 15:00:00", 0, 1, 0, "2024/12/31 12:00:00", 0, 1, "もにか", 22, 133201, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 450, 133201, 0, 2.09, 0, 0, 4, "モニカ（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 718, 2, 133501, 133501, "2025/07/23 11:59:59", 0, 0, 0, "2025/07/10 12:00:00", 0, 3, "されん", 22, 133501, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 450, 133501, 0, 2.09, 0, 0, 4, "サレン（ニューイヤー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 445, 1, 133601, 133601, "2025/07/31 11:59:59", 0, 0, 0, "2025/07/23 12:00:00", 0, 3, "めどぅーさ", 0, 133601, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 450, 133601, 0, 2.09, 0, 0, 0, "メドゥーサ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 717, 2, 133701, 133701, "2025/08/22 11:59:59", 0, 0, 0, "2025/08/15 15:00:00", 0, 3, "らびりすた", 0, 133701, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 450, 133701, 0, 2.09, 0, 0, 8, "ラビリスタ（アルファ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 759, 2, 133801, 133801, "2025/08/22 11:59:59", 0, 0, 0, "2025/08/15 15:00:00", 0, 3, "ねねか", 0, 133801, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 450, 133801, 0, 2.09, 0, 0, 7, "ネネカ（アルファ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 228, 1, 133901, 133901, "2025/08/22 11:59:59", 0, 0, 0, "2025/08/15 15:00:00", 0, 3, "くりすてぃーな", 0, 133901, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 450, 133901, 0, 2.09, 0, 0, 6, "クリスティーナ（アルファ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 746, 2, 134001, 134001, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "ふぃお", 0, 134001, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 450, 134001, 0, 2.09, 0, 0, 0, "フィオ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 134101, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "ふぶき", 1, 134101, "", 0, 0, 0, 0.0, 0, 0, 5, "フブキ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 134201, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "らいらえる", 1, 134201, "", 0, 0, 0, 0.0, 0, 0, 7, "ライラエル（クリスマス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 778, 2, 134301, 134301, "2025/09/30 11:59:59", 0, 0, 0, "2025/09/16 15:00:00", 0, 3, "らんふぁ", 0, 134301, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 450, 134301, 0, 2.09, 0, 0, 7, "ランファ（儀装束）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 773, 2, 134401, 134401, "2030/12/31 15:00:00", 0, 0, 0, "2025/03/15 15:00:00", 0, 3, "ちか", 21, 134401, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 450, 134401, 0, 2.09, 0, 0, 7, "チカ（儀装束）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 719, 2, 134501, 134501, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "くろーちぇ", 0, 134501, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 450, 134501, 0, 2.09, 0, 0, 0, "クローチェ（エアリアル）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 526, 1, 134601, 134601, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "あおい", 35, 134601, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 450, 134601, 0, 2.09, 0, 0, 35, "アオイ（パイロット）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 490, 1, 134701, 134701, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "ほうおう", 7, 134701, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 450, 134701, 0, 2.09, 0, 0, 7, "ホウオウ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 485, 1, 134801, 134801, "2025/06/10 11:59:59", 0, 0, 0, "2025/05/31 12:00:00", 0, 3, "つむぎ", 1, 134801, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 450, 134801, 0, 1.84, 0, 0, 1, "ツムギ（ジオ・ゲヘナ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 196, 1, 134901, 134901, "2025/06/20 11:59:59", 0, 0, 0, "2025/06/10 12:00:00", 0, 3, "かのん", 0, 134901, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 450, 134901, 0, 2.09, 0, 0, 2, "カノン", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 785, 2, 135001, 135001, "2025/07/10 11:59:59", 0, 0, 0, "2025/06/30 12:00:00", 0, 3, "えりす", 21, 135001, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 450, 135001, 0, 2.09, 0, 0, 7, "エリス（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 143, 1, 135101, 135101, "2025/07/23 11:59:59", 0, 0, 0, "2025/07/10 12:00:00", 0, 3, "しぇふぃ", 4, 135101, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 450, 135101, 0, 2.09, 0, 0, 4, "シェフィ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 548, 2, 135201, 135201, "2025/07/31 11:59:59", 0, 0, 0, "2025/07/23 12:00:00", 0, 3, "ぷれしあ", 7, 135201, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 450, 135201, 0, 2.09, 0, 0, 7, "プレシア（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 413, 1, 135301, 135301, "2025/08/10 11:59:59", 0, 0, 0, "2025/07/31 12:00:00", 0, 3, "くりあ", 54, 135301, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 450, 135301, 0, 2.09, 0, 0, 54, "クリア（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 553, 2, 135401, 135401, "2025/08/15 14:59:59", 0, 0, 0, "2025/08/10 12:00:00", 0, 3, "あねもね", 52, 135401, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 450, 135401, 0, 2.09, 0, 0, 2, "アネモネ（サマー）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 213, 1, 135501, 135501, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "あいら", 0, 135501, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 450, 135501, 0, 2.09, 0, 0, 1, "アイラ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 198, 1, 135601, 135601, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "しなつ", 0, 135601, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", 450, 135601, 0, 0.4, 0, 0, 4, "シナツ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 291, 1, 135701, 135701, "2030/12/31 15:00:00", 0, 0, 0, "2025/09/16 15:00:00", 0, 3, "ひより", 0, 135701, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", 450, 135701, 0, 1.84, 0, 0, 1, "ヒヨリ（サラサリア）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 830, 2, 135801, 135801, "2025/10/10 11:59:59", 0, 0, 0, "2025/09/30 12:00:00", 0, 3, "ゆきの", 0, 135801, "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", 450, 135801, 0, 2.09, 0, 0, 7, "ユキノ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 219, 1, 135901, 135901, "2025/10/24 11:59:59", 0, 0, 0, "2025/10/10 12:00:00", 0, 3, "さつき", 0, 135901, "【物理】前衛で、華奢な体躯に厚い仁義を宿す鬼のお嬢。\n攻防自己強化や行動不能無効化で豪胆に立ち続け、自分が\n呪詛状態の時に振るう追加攻撃で、怪力無双の力を示す。", 450, 135901, 0, 1.84, 0, 0, 3, "サツキ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 732, 1, 136001, 136001, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/31 12:00:00", 0, 3, "あらくね", 0, 136001, "【物理】後衛で、喪われた光を求めてもがく元『六凶』。\n敵のＵＢを遅延する【遮絶の操糸】や、味方単体のＵＢを\n連続発動可能にする【賦活の糸】を戦場に張り巡らせる。", 450, 136001, 0, 2.09, 0, 0, 11, "アラクネ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (1, 432, 1, 136101, 136101, "2025/11/03 11:59:59", 0, 0, 0, "2025/10/24 12:00:00", 0, 3, "さくら", 0, 136101, "【物理】中衛で不運に抗い歌い続けるゾンビィアイドル。\n一度倒れても立ち上がり、ＴＰを糧に強化されるスキルの\nダメージと味方の支援で、サガの心をアストルムに刻む。", 450, 136101, 0, 1.74, 0, 0, 0, "サクラ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 198, 1, 136201, 136201, "2030/12/31 15:00:00", 0, 0, 0, "2025/11/14 15:00:00", 0, 3, "なーな", 3, 136201, "【物理】前衛でダメダメでも逃げず戦うアルミラージ娘。\n最も近くの味方に強化や行動不能無効の付与、回復を行い\n敵の注意をそらすことで、過酷な世界を生き延びる。", 450, 136201, 0, 2.09, 0, 0, 3, "ナーナ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 136601, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, "めどぅーさ", 1, 136601, "", 0, 0, 0, 0.0, 0, 0, 1, "メドゥーサ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 136701, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "らびりすた", 1, 136701, "", 0, 0, 0, 0.0, 0, 0, 8, "ラビリスタ（アルファ）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 136801, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "らんふぁ", 1, 136801, "", 0, 0, 0, 0.0, 0, 0, 7, "ランファ（儀装束）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 566, 2, 137101, 137101, "2030/12/31 15:00:00", 0, 0, 0, "2025/08/15 15:00:00", 0, 3, "にのん", 47, 137101, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 450, 137101, 0, 2.09, 0, 0, 8, "ニノン（サマー）", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 137201, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "らびりすた", 2, 137201, "", 0, 0, 0, 0.0, 0, 0, 2, "ラビリスタ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 137301, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "かのん", 1, 137301, "", 0, 0, 0, 0.0, 0, 0, 2, "カノン", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 688, 2, 137401, 137401, "2025/11/14 14:59:59", 0, 0, 0, "2025/11/03 12:00:00", 0, 3, "かすみ", 21, 137401, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", 450, 137401, 0, 2.09, 0, 0, 7, "カスミ（シスター）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 137501, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "あいら", 1, 137501, "", 0, 0, 0, 0.0, 0, 0, 1, "アイラ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 137801, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "ゆきの", 1, 137801, "", 0, 0, 0, 0.0, 0, 0, 7, "ユキノ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 0, 138601, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 3, "さくら", 1, 138601, "", 0, 0, 0, 0.0, 0, 0, 1, "サクラ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 245, 1, 170101, 170101, "2030/12/31 15:00:00", 0, 0, 4, "2015/04/01 15:00:00", 0, 3, "じーた", 34, 170101, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 450, 105701, 0, 1.965, 0, 0, 34, "ジータ", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 199, 1, 180101, 180101, "2025/11/03 11:59:59", 0, 0, 7, "2025/10/31 12:00:00", 0, 3, "ひより", 0, 180101, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 450, 180101, 0, 1.62, 0, 0, 0, "ヒヨリ（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 767, 2, 180201, 180201, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "ゆい", 0, 180201, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 450, 180201, 0, 1.92, 0, 0, 0, "ユイ（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 377, 1, 180301, 180301, "2025/11/03 11:59:59", 0, 0, 7, "2025/10/31 12:00:00", 0, 3, "れい", 0, 180301, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 450, 180301, 0, 1.965, 0, 0, 0, "レイ（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 155, 1, 180401, 180401, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "ぺこりーぬ", 0, 180401, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 450, 180401, 0, 1.965, 0, 0, 0, "ペコリーヌ（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 555, 1, 180501, 180501, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "こっころ", 0, 180501, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 450, 180501, 0, 2.14, 0, 0, 0, "コッコロ（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 747, 2, 180601, 180601, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "きゃる", 0, 180601, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 450, 180601, 0, 1.92, 0, 0, 0, "キャル（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 732, 1, 180701, 180701, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "はつねしおり", 0, 180701, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 450, 180701, 0, 1.75, 0, 0, 0, "ハツネ＆シオリ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 465, 1, 180801, 180801, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "みそぎみみきょうか", 0, 180801, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 450, 180801, 0, 1.5, 0, 0, 0, "ミソギ＆ミミ＆キョウカ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 421, 1, 180901, 180901, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "あきのされん", 0, 180901, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 450, 180901, 0, 2.09, 0, 0, 0, "アキノ＆サレン", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 577, 2, 181001, 181001, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "あんぐれあ", 0, 181001, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 450, 181001, 0, 2.09, 0, 0, 0, "アン＆グレア", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 551, 1, 181101, 181101, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "しずるりの", 0, 181101, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 450, 181101, 0, 1.92, 0, 0, 0, "シズル＆リノ", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 368, 1, 181201, 181201, "2025/11/03 11:59:59", 0, 0, 1, "2025/10/31 12:00:00", 0, 3, "しぇふぃ", 0, 181201, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 450, 181201, 0, 1.92, 0, 0, 0, "シェフィ（プリンセス）", 1);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 1, 0, 190801, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, "かりん", 1, 190801, "", 0, 0, 0, 0.0, 0, 0, 1, "カリン", 0);
