INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 850, 1, 191301, 191301, "2030/12/31 15:00:00", 0, 0, 0, "2015/04/01 15:00:00", 0, 1, "かずまさ", 6, 191301, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 450, 191301, 0, 2.22, 0, 0, 6, "カズマサ", 1);
